## Proposed changes

the weight should be positive num, as have check the value valid use DCHECK_GT(c._weight, 0) in Centroid;
```
    void add(const Centroid& c) {
        DCHECK_GT(c._weight, 0);
        if (_weight != 0.0) {
            _weight += c._weight;
            _mean += c._weight * (c._mean - _mean) / _weight;
        } else {
            _weight = c._weight;
            _mean = c._mean;
        }
    }
```

